    /// <summary>
    /// The Google Cloud project against which all image and image family      references will be resolved. It is best practice to define      image-project. A full list of available projects can be generated by      running gcloud projects list.      * If specifying one of our public images, image-project must be       provided.      * If there are several of the same image-family value in multiple       projects, image-project must be specified to clarify the image to be       used.      * If not specified and either image or image-family is provided, the       current default project is used.      At most one of these can be specified:       --image=IMAGE       Specifies the boot image for the instances. For each instance, a new       boot disk will be created from the given image. Each boot disk will       have the same name as the instance. To view a list of public images       and projects, run $ gcloud compute images list. It is best practice       to use --image when a specific version of an image is needed.         When using this option, --boot-disk-device-name and --boot-disk-size       can be used to override the boot disk's device name and size,       respectively.       --image-family=IMAGE_FAMILY       The image family for the operating system that the boot disk will be       initialized with. Compute Engine offers multiple Linux distributions,       some of which are available as both regular and Shielded VM images.       When a family is specified instead of an image, the latest       non-deprecated image associated with that family is used. It is best       practice to use --image-family when the latest version of an image is       needed.         By default, debian-12 is assumed for this flag.      At most one of these can be specified:       --public-ptr       Creates a DNS PTR record for the external IP of the instance.       --no-public-ptr       If provided, no DNS PTR record is created for the external IP of the       instance. Mutually exclusive with public-ptr-domain.      At most one of these can be specified:       --public-ptr-domain=PUBLIC_PTR_DOMAIN       Assigns a custom PTR domain for the external IP of the instance.       Mutually exclusive with no-public-ptr.       --no-public-ptr-domain       If both this flag and --public-ptr are specified, creates a DNS PTR       record for the external IP of the instance with the PTR domain name       being the DNS name of the instance.      Specifies the reservation for the instance.       --reservation=RESERVATION       The name of the reservation, required when       --reservation-affinity=specific.       --reservation-affinity=RESERVATION_AFFINITY; default="any"       The type of reservation for the instance. RESERVATION_AFFINITY must       be one of:         any         Consume any available, matching reservation.       none         Do not consume from any reserved capacity.       specific         Must consume from a specific reservation.      At most one of these can be specified:       --scopes=[SCOPE,...]       If not provided, the instance will be assigned the default scopes,       described below.         SCOPE can be either the full URI of the scope or an alias. Default       scopes are assigned to all instances. Available aliases are:          Alias         URI        bigquery        https://www.googleapis.com/auth/bigquery        cloud-platform     https://www.googleapis.com/auth/cloud-platform        cloud-source-repos   https://www.googleapis.com/auth/source.full_control        cloud-source-repos-ro https://www.googleapis.com/auth/source.read_only        compute-ro       https://www.googleapis.com/auth/compute.readonly        compute-rw       https://www.googleapis.com/auth/compute        datastore       https://www.googleapis.com/auth/datastore        default        https://www.googleapis.com/auth/devstorage.read_only                   https://www.googleapis.com/auth/logging.write                   https://www.googleapis.com/auth/monitoring.write                   https://www.googleapis.com/auth/pubsub                   https://www.googleapis.com/auth/service.management.readonly                   https://www.googleapis.com/auth/servicecontrol                   https://www.googleapis.com/auth/trace.append        gke-default      https://www.googleapis.com/auth/devstorage.read_only                   https://www.googleapis.com/auth/logging.write                   https://www.googleapis.com/auth/monitoring                   https://www.googleapis.com/auth/service.management.readonly                   https://www.googleapis.com/auth/servicecontrol                   https://www.googleapis.com/auth/trace.append        logging-write     https://www.googleapis.com/auth/logging.write        monitoring       https://www.googleapis.com/auth/monitoring        monitoring-read    https://www.googleapis.com/auth/monitoring.read        monitoring-write    https://www.googleapis.com/auth/monitoring.write        pubsub         https://www.googleapis.com/auth/pubsub        service-control    https://www.googleapis.com/auth/servicecontrol        service-management   https://www.googleapis.com/auth/service.management.readonly        sql (deprecated)    https://www.googleapis.com/auth/sqlservice        sql-admin       https://www.googleapis.com/auth/sqlservice.admin        storage-full      https://www.googleapis.com/auth/devstorage.full_control        storage-ro       https://www.googleapis.com/auth/devstorage.read_only        storage-rw       https://www.googleapis.com/auth/devstorage.read_write        taskqueue       https://www.googleapis.com/auth/taskqueue        trace         https://www.googleapis.com/auth/trace.append        userinfo-email     https://www.googleapis.com/auth/userinfo.email         DEPRECATION WARNING: https://www.googleapis.com/auth/sqlservice       account scope and sql alias do not provide SQL instance management       capabilities and have been deprecated. Please, use       https://www.googleapis.com/auth/sqlservice.admin or sql-admin to       manage your Google SQL Service instances.       --no-scopes       Create instance without scopes      At most one of these can be specified:       --service-account=SERVICE_ACCOUNT       A service account is an identity attached to the instance. Its access       tokens can be accessed through the instance metadata server and are       used to authenticate applications on the instance. The account can be       set using an email address corresponding to the required service       account.         If not provided, the instance will use the project's default service       account.       --no-service-account       Create instance without service account
    /// </summary>
    [CliOption("--image-project", Format = OptionFormat.EqualsSeparated)]
